import { Button, Col, Container, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import { FaPlay } from "react-icons/fa";

function PlayButton() {
  return (
    <Container>
      <h1>Button</h1>
      <FaPlay />
    </Container>
  );
}

export default PlayButton;
